Felt like getting more in touch with my feminine nature and create some art with the help of @shot_of_art 🥰, and add pop of color to my walls at home. Thank you guys for guiding me and teaching me the first steps in creating art. I’m definitely coming back 🥰❤️
@shot_of_art is a place where you can explore your creative side and be guided in the process by real artists! And then you take your creation home ☺️. I need more of this in my life ☺️🙏🏻
#shotofart #art #artist #weareallartists
